node.text:
Вот и все... 3 года позади. Теперь мы выпускники😭 
Как же будет не хватать всего этого. Построений по вторникам и четвергам,  самых веселых лекций,рукопашки, стрельбы. Всееее. Все это позади😰 Только сейчас начинаешь осозновать, что всего этого больше не будет. За 3 года проведенные в стенах родной академии, мы стали большой дружной семьей. Мы стали одним целым. Ведь нигде нет той атмосферы, которая есть в академии. Здесь тебе всегда помогут, в любое время суток. Здесь всегда поддержат, и заставят улыбнуться, даже если это не возможно.
Мы прошли через многое. Было много побед, поражений. Но мы не падали духом и пробовали снова. 
Те, кто не бывал здесь, никогда не поймут, что такое ДПА. 
Даже сейчас, когда мы выпустились, мы не оставим Академию. Мы  просто не сможем без нее. Мы часть большой семьи.
А 1 и 2 курсу хочу пожелать успехов, и ценить время проведенное здесь. Ведь оно не сравниться ни с чем.
Спасибо вам за эти 3 самых лучших года в моей жизни
